QuestionList.create!([
  {id: 1, name: "Are Process Sheets present (if required)?", partnumberguide: "basic", sort: 30, active_status: 1, created_at: "2017-05-10 17:54:37", updated_at: "2017-05-10 17:54:11"},
  {id: 2, name: "Is the First off completed correctly and is it signed off (if required)?", partnumberguide: "basic", sort: 50, active_status: 1, created_at: "2017-05-10 17:54:37", updated_at: "2017-05-10 17:54:18"},
  {id: 3, name: "Is Operator following the SWI properly (if applicable)?", partnumberguide: "basic", sort: 70, active_status: 1, created_at: "2017-05-10 17:54:37", updated_at: "2017-05-10 17:54:24"},
  {id: 4, name: "Does the OIS show the operator is doing all required checks (if required)?", partnumberguide: "basic", sort: 90, active_status: 1, created_at: "2017-05-10 17:54:37", updated_at: "2017-05-10 17:54:30"},
  {id: 5, name: "Ask the operator to measure a feature and record the feature number and measurement value here (like this:  98, 2.346)?", partnumberguide: "basic", sort: 110, active_status: 1, created_at: "2017-05-10 17:54:37", updated_at: "2017-05-10 17:54:37"},
  {id: 6, name: "Are gauges defined on the process sheet at the station (if required)? Record numbers below.", partnumberguide: "basic", sort: 130, active_status: 1, created_at: "2017-05-10 17:54:37", updated_at: nil},
  {id: 7, name: "Are Traceability Tags completed properly?", partnumberguide: "basic", sort: 150, active_status: 1, created_at: "2017-05-10 17:54:37", updated_at: nil},
  {id: 8, name: "If present, is operator aware of and following any QA/SI/TPC notices?", partnumberguide: "basic", sort: 170, active_status: 1, created_at: "2017-05-10 17:54:37", updated_at: nil},
  {id: 9, name: "If present, are error proofing parts (red rabbits) available, has error proofing been verified and are the red rabbits stored in the designated storage location (i.e. Hooks, shelf etc...)?", partnumberguide: "basic", sort: 190, active_status: 1, created_at: "2017-05-10 17:54:37", updated_at: nil},
  {id: 10, name: "What Part Number are you auditing?", partnumberguide: "basic", sort: 210, active_status: 1, created_at: "2017-05-10 17:54:37", updated_at: nil},
  {id: 11, name: "What operation are you auditing?", partnumberguide: "basic", sort: 230, active_status: 1, created_at: "2017-05-10 17:54:37", updated_at: nil},
  {id: 12, name: "Is there evidence that operators are stapling the OIS to the first off?", partnumberguide: "all parts", sort: 250, active_status: 1, created_at: "2017-05-10 17:54:37", updated_at: nil},
  {id: 13, name: "[Compact] Ensure there is no oil dripping onto press bed in or close to path of powder shoe.", partnumberguide: "Common to Parts (50-1437, 50-5710, 50-1467, 50-9341, 50-0455, 50-0786, 50-1731, 50-3632, 50-1713, 50-3627, 50-1858, 50-1448, 50-9641)", sort: 270, active_status: 1, created_at: "2017-05-10 17:54:37", updated_at: nil},
  {id: 14, name: "Are the proper ring test red rabbits for the part being run, hanging on the designated hooks at the workstation?", partnumberguide: "Common to Parts (50-1437, 50-5710, 50-1467, 50-9341, 50-0455, 50-0786, 50-1731, 50-3632, 50-1713, 50-3627, 50-1858, 50-1448, 50-9641)", sort: 290, active_status: 1, created_at: "2017-05-10 17:54:37", updated_at: nil},
  {id: 15, name: "Is the ring test verification documented on the Verification Log at the prescribed frequency?", partnumberguide: "Common to Parts (50-1437, 50-5710, 50-1467, 50-9341, 50-0455, 50-0786, 50-1731, 50-3632, 50-1713, 50-3627, 50-1858, 50-1448, 50-9641)", sort: 310, active_status: 1, created_at: "2017-05-10 17:54:37", updated_at: nil},
  {id: 16, name: "Is operator ring testing parts 100%?", partnumberguide: "Common to Parts (50-1437, 50-5710, 50-1467, 50-9341, 50-0455, 50-0786, 50-1731, 50-3632, 50-1713, 50-3627, 50-1858, 50-1448, 50-9641)", sort: 330, active_status: 1, created_at: "2017-05-10 17:54:37", updated_at: nil},
  {id: 17, name: "Is the  automatic weigh scale verification being done at required frequency?", partnumberguide: "Common to 50-1437, 50-5710, 50-1467, 50-9341, 50-0455", sort: 350, active_status: 1, created_at: "2017-05-10 17:54:37", updated_at: nil},
  {id: 18, name: "Ensure grippers are picking part up parallel to press bed (should be approx. 1/4 inch gap between press bed and part when part is in the grippers).", partnumberguide: "Common to 50-1437, 50-5710, 50-1467, 50-9341, 50-0455", sort: 370, active_status: 1, created_at: "2017-05-10 17:54:37", updated_at: nil},
  {id: 19, name: "Ensure there is no powder on spline face and that execss powder wiper and blow off are functioning (should be no excess powder on spline face).", partnumberguide: "Common to 50-1437, 50-5710, 50-1467, 50-9341, 50-0455", sort: 390, active_status: 1, created_at: "2017-05-10 17:54:37", updated_at: nil},
  {id: 20, name: "Are hardening faulted parts being recorded on the log sheet and placed in the red bin ?", partnumberguide: "Common to 50-1437, 50-5710, 50-1467, 50-9341, 50-0455", sort: 410, active_status: 1, created_at: "2017-05-10 17:54:37", updated_at: nil},
  {id: 21, name: "Is the fault, time and shift being written on the faulted parts that are in the red bin?", partnumberguide: "Common to 50-1437, 50-5710, 50-1467, 50-9341, 50-0455", sort: 430, active_status: 1, created_at: "2017-05-10 17:54:37", updated_at: nil},
  {id: 22, name: "Are the stamps from induction legible on parts (Optimize Line: 1 & 2 Trilobe Line: 3 & 4)", partnumberguide: "Common to 50-1437, 50-5710, 50-1467, 50-9341, 50-0455", sort: 450, active_status: 1, created_at: "2017-05-10 17:54:37", updated_at: nil},
  {id: 23, name: "Is the induction overflow bin labeled with a placard that says \"Operation Completed: INDUCTION\"?", partnumberguide: "Common to 50-1437, 50-5710, 50-1467, 50-9341, 50-0455", sort: 470, active_status: 1, created_at: "2017-05-10 17:54:37", updated_at: nil},
  {id: 24, name: "Is case depth being verified and are results logged in the database regularly (see Team Leader)?", partnumberguide: "Common to 50-1437, 50-5710, 50-1467, 50-9341, 50-0455", sort: 490, active_status: 1, created_at: "2017-05-10 17:54:37", updated_at: nil},
  {id: 25, name: "Is the cell free of any loose or stray parts?", partnumberguide: "Common to 50-1437, 50-5710, 50-1467, 50-9341, 50-0455", sort: 510, active_status: 1, created_at: "2017-05-10 17:54:37", updated_at: nil},
  {id: 26, name: "Are the wash nozzles on the slurry arm aimed correctly (pointing at the pinion holes) and spraying the parts with enough force to remove machining chips and deburr media?", partnumberguide: "Common to 50-1437, 50-5710, 50-1467, 50-9341, 50-0455", sort: 530, active_status: 1, created_at: "2017-05-10 17:54:37", updated_at: nil},
  {id: 27, name: "Are all rejects getting recorded on the tally sheet and placed in the red bin", partnumberguide: "Common to 50-1437, 50-5710, 50-1467, 50-9341, 50-0455", sort: 550, active_status: 1, created_at: "2017-05-10 17:54:37", updated_at: nil},
  {id: 28, name: "Is the failure mode being written on the reject parts that are in the red bin?", partnumberguide: "Common to 50-1437, 50-5710, 50-1467, 50-9341, 50-0455", sort: 570, active_status: 1, created_at: "2017-05-10 17:54:37", updated_at: nil},
  {id: 29, name: "Is the operator following the SWI Sequence", partnumberguide: "Common to 50-1437, 50-5710, 50-1467, 50-9341, 50-0455", sort: 590, active_status: 1, created_at: "2017-05-10 17:54:37", updated_at: nil},
  {id: 30, name: "Are parts Julian date stamped and legible?", partnumberguide: "Common to 50-1437, 50-5710, 50-1467, 50-9341, 50-0455", sort: 610, active_status: 1, created_at: "2017-05-10 17:54:37", updated_at: nil},
  {id: 31, name: "Is the error verification log filled out for the hole position gauge?", partnumberguide: "Common to 50-1437, 50-5710, 50-1467, 50-9341, 50-0455", sort: 630, active_status: 1, created_at: "2017-05-10 17:54:37", updated_at: nil}
])



